const incomeRank = resolve => {
  import('./incomeRank').then(module => {
    resolve(module)
  })
}
const marketingRank = resolve => {
  import('./marketingRank').then(module => {
    resolve(module)
  })
}
const preview = resolve => {
  import('./preview').then(module => {
    resolve(module)
  })
}

export default [
  {
    name: 'otherIncomeRank',
    path: '/other/incomeRank',
    component: incomeRank,
    meta: {
      nav: false,
      auth: true,
      title: '收入榜单',
      keepAlive: true
    }
  },
  {
    name: 'otherMarketingRank',
    path: '/other/marketingRank',
    component: marketingRank,
    meta: {
      nav: false,
      auth: true,
      title: '营销榜单',
      keepAlive: true
    }
  },
  {
    name: 'otherPreview',
    path: '/other/preview/:id',
    component: preview,
    meta: {
      nav: false,
      auth: false,
      title: '简介',
      keepAlive: true
    }
  }
]
